  const loadName=()=>{
  axios.get("https://ecommerce-response.herokuapp.com")
  .then(response=>{
  setName(response.data)
    })
  }


return(

<div className="start-div">
<ul>
   {name&&name.map(el=> <li key={el.id}>{el.name} {el.price} <img src={el.photo}/><button>add to cart</button></li>)}

</ul>

</div>

);
}
